import {Dialog as DialogUI, DialogTitle, DialogContent} from "@material-ui/core"

const Dialog = ({open, onClose, title})  => {
    return <DialogUI fullWidth open={open} onClose={onClose}>
        <DialogTitle ><h2>{title}</h2></DialogTitle>
        <DialogContent><input></input></DialogContent>
    </DialogUI>
}

export default Dialog;

const Subtitle = styled.h2`
    display: flex;
    justify-content: center;
    align-items: center;
`
